import React from "react";
import { View, Text } from "react-native";
import MenuHeader from "../layouts/MenuHeader";
export default ({ navigation, titulo }) => {
  return (
    <View>
      <MenuHeader navigation={navigation} titulo="Confira nossas vagas" />
      <Text>Vagas</Text>
    </View>
  );
};
